import React from 'react';
import ReactDOM from 'react-dom';

import './index.scss';
import 'macro-css';

import App from './App';
import AuthPage from "./pages/AuthPage";

ReactDOM.render(
  <React.StrictMode>
      { localStorage.getItem('access_token') ? <App/> : <AuthPage/>}
  </React.StrictMode>,
  document.getElementById('root'),
);
